import React from "react";
import "./Slide1.css";
import "../../App.css";
import buttonImg from "../../assets/slide1/Button.png";
import spike from "../../assets/slide1/Layer8.png";

export default function Slide1({ goToNextSlide }) {
  return (
    <div className="item item-1">
      <p className="helo_txt">ПРИВЕТ,</p>
      <p className="title">
        ЭТО <span className="title_HE">не</span>
        <br /> коммерческое
        <br /> задание{" "}
        <img src={buttonImg} className="buttonNext animated-button" onClick={goToNextSlide}></img>
      </p>
      <img src={spike} className="Layer8"></img>
    </div>
  );
}
